# 392. Is Subsequence

class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        if s == t:
            return True
        new_string = list(t)
        new_set = set(s)
        context = {}
        for i in range(len(t)):
            if t[i] not in new_set:
                new_string[i] = ""
        new_string = "".join(new_string)
        return new_string == s or s in new_string

print(Solution().isSubsequence(s = "abc", t = "ahbgdc"))
print(Solution().isSubsequence(s = "axc", t = "ahbgdc"))
print(Solution().isSubsequence(s = "ab", t = "baab"))
print(Solution().isSubsequence(s = "b", t = "c"))
print(Solution().isSubsequence(s = "leeeeetcode", t = ""))
